import React, { Component } from "react";
import {Layout, Menu, Breadcrumb, Icon} from "antd";
import './css/app.css';

//const { Layout, Menu, Breadcrumb, Icon } = antd;

const { Header, Content, Footer, Sider } = Layout;
const { SubMenu } = Menu;

class App extends Component {
  state = {
    collapsed: false,
  };

  onCollapse = collapsed => {
    console.log(collapsed);
    this.setState({ collapsed });
  };

  render() {
    //return <div>I'M READY TO USE THE BACK END APIS! :-)</div>;
    return (
      <Layout style={{ minHeight: '100vh' }}>
        <Sider theme="light" width ="250" collapsible collapsed={this.state.collapsed} onCollapse={this.onCollapse}>
          <div className="logo"/>
          <Menu theme="light" defaultSelectedKeys={['1']} mode="inline">
            <Menu.Item key="1">
              <span>Services</span>
            </Menu.Item>
            <SubMenu
              key="sub1"
              title={
                <span>
                  <Icon type="car" />
                  <span>Parking</span>
                </span>
              }
            >
              <Menu.Item key="2">North Parking Garage</Menu.Item>
              <Menu.Item key="3">South Parking Garage</Menu.Item>
              <Menu.Item key="4">West Parking Garage</Menu.Item>
              <Menu.Item key="5">Park & Ride Lot</Menu.Item>
            </SubMenu>
            <SubMenu
              key="sub2"
              title={
                <span>
                  <Icon type="wallet" />
                  <span>Food & Drinks</span>
                </span>
              }
            >
              {/* <Menu.Item key="6">Team 1</Menu.Item>
              <Menu.Item key="8">Team 2</Menu.Item> */}
            </SubMenu>
            <SubMenu key="sub3"
              title={
                <span>
                  <Icon type="printer" />
                  <span>Printers</span>
                </span>
              }>
            </SubMenu>
          </Menu>
        </Sider>
        <Layout>
          <Header className= "header">
            <img src={require('./css/logo2_sjsu.png')} alt= "SJSU"></img>
          </Header>
          <Content style={{ margin: '0 16px' }}>
            <div className="links">
              <a href={"https://www.sjsu.edu"} target={"_blank"}> SJSU Home |</a>
              <a href={"/"}> ICMap Home </a>
            </div>
            <div style={{ padding: 24, background: '#fff', minHeight: 360 }}>Bill is a cat.</div>
          </Content>
          <Footer style={{ textAlign: 'center' }}>SJSU Interactive Campus Map Â©2019 Created by ICMap</Footer>
        </Layout>
      </Layout>
    );
  }

}

export default App;
